import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TagList = () => {
  const [tags, setTags] = useState([]);

  const fetchTags = async () => {
    try {
      const response = await axios.get('http://localhost:8082/tags'); // Substitua pela URL do seu servidor
      setTags(response.data.tags);
    } catch (error) {
      console.error('Erro ao obter tags:', error);
    }
  };

  useEffect(() => {
    fetchTags();
  }, []);

  return (
    <div>
      <h2>Lista de Tags RFID</h2>
      <ul>
        {tags.map(tag => (
          <li key={tag}>{tag}</li>
        ))}
      </ul>
    </div>
  );
};

export default TagList;
